import React from 'react';
const Header = () => {
    var a = document.querySelectorAll('.nav-elements a');
    for (var i = 0, length = a.length; i < length; i++) {
        a[i].onclick = function () {
            var b = document.querySelector(".menu li.active");
            if (b) {
                b.classList.remove("active");
                this.parentNode.classList.add('active');
            }
        };
        return (
            <nav className="navbar">
                <div className="container">
                    <div className="nav-elements">
                        <ul>
                            <li className='active'>
                                <a href="/" className='nav-link' >Accueil</a>
                            </li>
                            <li>
                                <a href="/Galerie" className='nav-link' >Galerie</a>
                            </li>
                            <li>
                                <a href="/Tarifs_et_Prestations" className='nav-link' >tarifs et prestations</a>
                            </li>
                            <li>
                                <a href="/Contact" className='nav-link' >Contact</a>
                            </li>
                        </ul>
                    </div>
                </div>
            </nav>
        )
    }
}
export default Header
